import React from "react";
import { Navigate } from 'react-router-dom';
import { useSelector } from "react-redux";
import  Default  from '../../assets/images/default.jpeg'
import MainHeader from "../MainHeader/MainHeader";
import styles from './profile.module.scss'
import { useTranslation } from "react-i18next";
const Profile = () => {
  const { user: currentUser } = useSelector((state) => state.auth);
  console.log(currentUser)
  const { t } = useTranslation();

  if (!currentUser) {
    return <Navigate to="/login" />;
  }

return (
    <div className="container">
    <MainHeader/>

    <section>
  <div className={styles.main_container}>
  <div className={styles.left_block}>

    {!currentUser.profile_picture ? (
    <img className={styles.profile_picture} src={Default}></img>
    ) : (
      <img className={styles.profile_picture} src={currentUser.profile_picture}></img>

    ) }
    <p className={styles.user_name}>
      {currentUser.last_name}   {currentUser.first_name}
    </p>
    <p className={styles.user_email}>
      {currentUser.email}
</p>


    </div>

    <div className={styles.right_block}>

      <div  className={styles.info}>
        <div className={styles.info_top}>
          <p>{t('user_name')}</p>
          <img className={styles.info_top_img}></img>
        </div>
      </div >
      <div className={styles.info}>
      <div className={styles.info_top}>
      <p>Регион</p>

<img className={styles.info_top_img}></img>
      </div>

        </div>
        <div className={styles.info}>
        <div className={styles.info_top}>
        <p>{t('reg_password')}</p>

<img className={styles.info_top_img}></img>
        </div>

        </div>
        <div className={styles.info}>
        <div className={styles.info_top}>
        <p>E-mail</p>

        <img className={styles.info_top_img}></img>

        </div>

        </div>

    </div>
  </div>

    </section>
    </div>
  );
};

export default Profile;
